import React, { Component } from 'react';
import { BarChart, Bar } from 'recharts';

class TopEmployees extends Component {
    constructor(props) {
        super(props)
        this.state = {
            topEmployees: [{ name: "Jorge", sales: 40 }, { name: "Maria", sales: 20 }, { name: "Laura", sales: 50 }]
        }

    }


    render() {
        const renderLineChart = (
            <BarChart width={400} height={400} data={this.topEmployees}>
                <Bar type="monotone" dataKey="uv" stroke="#8884d8" />
            </BarChart>
        )


        return (<div>
            <BarChart width={400} height={400} data={this.topEmployees}>
                <Bar type="monotone" dataKey="uv" stroke="#8884d8" />
            </BarChart>
            </div>)
    }
}
export default TopEmployees;
